css:
atom-text-editor {
  background-color: #ffffff;
  color: #111213;
}
atom-text-editor::shadow .cursor {
  border-color: #8e908c;
}
atom-text-editor::shadow .cursor-line {
  background: #eeeeee !important;
}
atom-text-editor::shadow .highlights .highlight.selection .region {
  background-color: #e0e0e0;
}
atom-text-editor::shadow .line-number.cursor-line-no-selection,
atom-text-editor::shadow atom-text-editor :host.is-focused .line.cursor-line {
  background-color: #eeeeee;
}
.comment {
  color: #969896;
}
.keyword.operator.class,
.constant.other,
.source.php.embedded.line {
  color: #666969;
}
.variable,
.support.other.variable,
.string.other.link,
.string.regexp,
.entity.name.tag,
.entity.other.attribute-name,
.meta.tag,
.declaration.tag,
.markup.deleted.git_gutter {
  color: #c82829;
}
.constant.numeric,
.constant.language,
.support.constant,
.constant.character,
.variable.parameter,
.punctuation.section.embedded,
.keyword.other.unit {
  color: #f5871f;
}
.variable.language {
  color: #f5871f;
}
.entity.name.class,
.entity.name.type.class,
.support.type,
.support.class {
  color: #c99e00;
}
.string,
.constant.other.symbol,
.entity.other.inherited-class,
.entity.name.filename,
.markup.heading,
.markup.inserted.git_gutter {
  color: #718c00;
}
.keyword.operator,
.constant.other.color {
  color: #545454;
}
.entity.name.function,
.meta.function-call,
.support.function,
.keyword.other.special-method,
.meta.block-level,
.markup.changed.git_gutter {
  color: #4271ae;
}
.keyword,
.storage,
.storage.type {
  color: #8959a8;
}
.invalid {
  color: #ffffff;
  background-color: #c82829;
}
.meta.separator {
  color: #ffffff;
  background-color: #3e999f;
}
.invalid.deprecated {
  color: #ffffff;
  background-color: #8959a8;
}
.markup.inserted.diff,
.markup.deleted.diff,
.meta.diff.header.to-file,
.meta.diff.header.from-file {
  color: #ffffff;
}
.markup.inserted.diff,
.meta.diff.header.to-file {
  background-color: #b5bd68;
}
.markup.deleted.diff,
.meta.diff.header.from-file {
  background-color: #cc6666;
}
.meta.diff.header.from-file,
.meta.diff.header.to-file {
  color: #ffffff;
  background-color: #81a2be;
}
.meta.diff.range {
  font-style: italic;
  color: #3e999f;
}
.invisible-character,
.indent-guide {
  color: #c5c8c6;
}
